import React from "react";
import Slider from "react-slick";
import "./Styles/Carousel.css";

const Carousel = () => {
  const settings = {
    dots: false,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    arrows: true,
  };

  return (
    <div className="carousel-container">
      <Slider {...settings}>
        <div>
          <img src="https://via.placeholder.com/800x300" alt="Slide 1" />
        </div>
      </Slider>
    </div>
  );
};

export default Carousel;
